            strokeWeight: 1,
            strokeAlign: 'OUTSIDE',
            effects: [],
            characters:
              'Design tokens are the abstract but shared elements from which your design system is built.\n\nDesign tokens express any of the individual values that you build from: such as colors, spacing, and typographic features.\n\nTokens offer a form of contract between a designers intent and its fulfillment by developers. This means that both sides agree to avoid by all means anything thats not codified also as a token. For example, avoiding spacing values that are not also available as a token.Its similar in many ways to old-school styleguides, but tokens should only ever communicate strict, hard values. Styleguides can tend to be context-sensitive and full of explanationtokens must communicate without context or explanation.\n\nHowever: You may still want to add written guidance for usage. Its just that the tokens should be able to be consumed without understanding anything specific about them.\n\nYou should bind tokens to Figma styles whenever and wherever possible to simplify your own design work, but make sure that those are also represented here, as this page is where a developer will pick up tokens with Figmagic.',
