            id: '3163:2852',
            name:
              'Elements are named so because they are primarily meant to help scaffold anything that maps to standard HTML elements like input, button, h1, and form. With scaffolding we mean that these elements can be generated as code in a shape that is fitting for continued development. You can do simple flat elements or nested ones, where you want stateful behavior like being invalid or disabled. Open and inspect some of the elements to the right to see both patterns! Note how you can prefix with : to set/communicate a pseudo-selector (like :hover) and _ which will be ignored during code generation. Further description and element choice is made in the right-hand side Description panel. Click an element to see how various elements are set up. As the scaffolding is experimental you should pay attention to the expected Figma structure for it to work. Expect that many things are still unsupported (such as images) for now. You should definitely still continue to layout your elements/components as they should look in their final state, but understand that the output is likely not 100% complete right after generation. Pro tip: Use a plugin like Figma Redlines to communicate hard-to-see tokens/features like the padding inside of an Input element. Dont forget to add a prefixing _ so Figmagic can safely ignore the redlines.',
